import styled from "styled-components"

const Dot = styled.div`
    background: var(--red);
    color: white;
    border-radius: 50%;
    padding: 0.5rem;
    line-height: 1.5rem;
    min-width: 2rem;
    margin-left: 0.5rem;
    font-feature-settings: 'tnum';
    font-variant-numeric: tabular-nums;
`

export default function CartCount({count}){

    return <Dot>{count}</Dot>
}
